import React from "react";
import styled from "styled-components";

const Extension = () => {
  return (
    <ExtensionsWrapper>
      <ExtensionsList>
        {extensions.map((i) => {
          return (
            <ExtensionAnchor href={i.url}>
              <Extension>{i.title}</Extension>
            </ExtensionAnchor>
          );
        })}
      </ExtensionsList>
      <ExtendBtn>
        <ExtendIcon className="fas fa-caret-down"></ExtendIcon>
      </ExtendBtn>
    </ExtensionsWrapper>
  );
};

export default Extension;
